    def parse_user(self, response):
        user = UserItem()
        user['id'] = response.request.url.split('/')[-1]

        for i in range(596):
            key_name = "variation_%s" % i
            user["%s_%s" % (key_name, "name")] = None
            user["%s_%s" % (key_name, "value")] = None

        variations = response.css('div#variations tr')
        if variations and len(variations) > 0:
            for variation in variations:
                fields = variation.css("td")
                if len(fields) == 2:
                    variation_id = extract_field(fields[0], "a::attr(href)").split('/')[2]
                    variation_name = extract_field(fields[0], "td a::text")
                    variation_value = extract_field(fields[1], "td::text")
                    key_name = "variation_%s" % variation_id
                    user["%s_%s" % (key_name, "name")] = variation_name
                    user["%s_%s" % (key_name, "value")] = variation_value
        # print(user)
        yield user

    def parse(self, response):
        for user_id in PhenotypeSpider.user_ids:
            next_page = "%s%s" % (PhenotypeSpider.URL_PREFIX, user_id)
            self.user_id = user_id
            if next_page is not None:
                next_page = response.urljoin(next_page)
                yield scrapy.Request(next_page, callback=self.parse_user, dont_filter=True)
